import React from 'react';

class LoginForm extends React.Component {
  constructor(props) {
    super(props);
    this.handleSubmit = this.handleSubmit.bind(this);
    this.input = React.createRef();
  }

  handleSubmit(event) {
    alert('A name was submitted: ' + this.input.current.username.value);
    event.preventDefault();
  }

  render() {
    return (
      <form onSubmit={this.handleSubmit}>
        <label>
          Username:
          <input 
          name = "Username"
          type="text"
          ref={this.input} />
        </label>
        <br />
        <label>
          Password:
          <input 
          name = "Password"
          type="password"
          ref={this.input} />
        </label>
        <br />
        <input 
          name = "Submit"
          type="submit"
          value="Submit" />
      </form>
    );
  }
}

  export default LoginForm;
